import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () =>
{
	const items = ['Дело 1', 'Дело 2', 'Дело 3'];
	return(
		<ul>
			<li>{items[0]}</li>
			<li>{items[1]}</li>
			<li>{items[2]}</li>
		</ul>
	);
};

const AppHeader = () => { return(<h1>Список дел</h1>);};

const SearchPanel = () => {
	const searchText = 'Строка поиска';
	return(
		<input placeholder={searchText}/>
	);
};

const App = () =>
{
	return(
		<div>
			<AppHeader/>
			<SearchPanel/>
			<TodoList/>
		</div>
	);
};

//console.log(el);
ReactDOM.render(<App/>, document.getElementById('root'));
